// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Auth {
    struct User {
        string email;
        bytes32 passwordHash;
        string userType;
        bool exists;
    }

    mapping(address => User) public users;
    mapping(string => address) private emailToAddress;

    event UserRegistered(address indexed userAddress, string userType);
    event UserLoggedIn(address indexed userAddress, string userType);

    modifier userExists(address _address) {
        require(users[_address].exists, "User does not exist");
        _;
    }

    modifier userDoesNotExist(address _address) {
        require(!users[_address].exists, "User already exists");
        _;
    }

    function signup(
        string memory _email,
        bytes32 _passwordHash,
        string memory _userType
    ) public userDoesNotExist(msg.sender) {
        require(emailToAddress[_email] == address(0), "Email already registered");

        users[msg.sender] = User({
            email: _email,
            passwordHash: _passwordHash,
            userType: _userType,
            exists: true
        });

        emailToAddress[_email] = msg.sender;
        emit UserRegistered(msg.sender, _userType);
    }

    function login(
        string memory _email,
        bytes32 _passwordHash,
        string memory _userType
    ) public view userExists(msg.sender) returns (bool) {
        User memory user = users[msg.sender];

        require(
            keccak256(abi.encodePacked(user.email)) == keccak256(abi.encodePacked(_email)),
            "Invalid credentials"
        );
        require(user.passwordHash == _passwordHash, "Invalid credentials");
        require(
            keccak256(abi.encodePacked(user.userType)) == keccak256(abi.encodePacked(_userType)),
            "Invalid user type"
        );

        return true;
    }

    function getUserType(address _address) public view returns (string memory) {
        require(users[_address].exists, "User does not exist");
        return users[_address].userType;
    }
}

contracts/LogisticsRegistry.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract LogisticsRegistry {
    struct Company {
        string name;
        uint8 status; // 0: Pending, 1: Approved, 2: Rejected
        uint256 applications;
        address walletAddress;
    }

    Company[] public companies;
    address public owner;

    event CompanyStatusChanged(uint256 companyId, uint8 newStatus);

    constructor() {
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can perform this action");
        _;
    }

    function addCompany(string memory _name, address _walletAddress) public {
        companies.push(Company(_name, 0, 0, _walletAddress));
    }

    function approveCompany(uint256 _companyId) public onlyOwner {
        require(_companyId < companies.length, "Company does not exist");
        companies[_companyId].status = 1;
        emit CompanyStatusChanged(_companyId, 1);
    }

    function rejectCompany(uint256 _companyId) public onlyOwner {
        require(_companyId < companies.length, "Company does not exist");
        companies[_companyId].status = 2;
        emit CompanyStatusChanged(_companyId, 2);
    }

    function getCompaniesCount() public view returns (uint256) {
        return companies.length;
    }
}

contracts/Shipment.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Shipment {
    struct Vehicle {
        uint256 id;
        string vehicleType;
        string capacity;
        uint256 price;
        bool isAvailable;
    }

    struct ShipmentDetails {
        string source;
        string destination;
        uint256 vehicleId;
        string shipmentType;
        address customer;
        uint256 amount;
        uint256 timestamp;
        bool isActive;
    }

    mapping(uint256 => Vehicle) public vehicles;
    mapping(uint256 => ShipmentDetails) public shipments;
    uint256 public vehicleCount;
    uint256 public shipmentCount;
    address public owner;

    event ShipmentCreated(
        uint256 indexed shipmentId,
        address indexed customer,
        uint256 amount
    );

    constructor() {
        owner = msg.sender;
        // Initialize with some vehicles
        addVehicle("Truck", "1000kg", 5 ether);
        addVehicle("Van", "500kg", 3 ether);
        addVehicle("Mini Truck", "750kg", 4 ether);
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can perform this action");
        _;
    }

    function addVehicle(
        string memory vehicleType,
        string memory capacity,
        uint256 price
    ) public onlyOwner {
        vehicleCount++;
        vehicles[vehicleCount] = Vehicle(
            vehicleCount,
            vehicleType,
            capacity,
            price,
            true
        );
    }

    function getAvailableVehicles(string memory source, string memory destination)
        public
        view
        returns (Vehicle[] memory)
    {
        uint256 availableCount = 0;
        for (uint256 i = 1; i <= vehicleCount; i++) {
            if (vehicles[i].isAvailable) {
                availableCount++;
            }
        }

        Vehicle[] memory availableVehicles = new Vehicle[](availableCount);
        uint256 currentIndex = 0;

        for (uint256 i = 1; i <= vehicleCount; i++) {
            if (vehicles[i].isAvailable) {
                availableVehicles[currentIndex] = vehicles[i];
                currentIndex++;
            }
        }

        return availableVehicles;
    }

    function createShipment(
        string memory source,
        string memory destination,
        uint256 vehicleId,
        string memory shipmentType
    ) public payable {
        require(vehicles[vehicleId].isAvailable, "Vehicle not available");
        require(msg.value == vehicles[vehicleId].price, "Incorrect payment amount");

        shipmentCount++;
        shipments[shipmentCount] = ShipmentDetails(
            source,
            destination,
            vehicleId,
            shipmentType,
            msg.sender,
            msg.value,
            block.timestamp,
            true
        );

        vehicles[vehicleId].isAvailable = false;
        emit ShipmentCreated(shipmentCount, msg.sender, msg.value);
    }

    function completeShipment(uint256 shipmentId) public onlyOwner {
        require(shipments[shipmentId].isActive, "Shipment not active");
        shipments[shipmentId].isActive = false;
        vehicles[shipments[shipmentId].vehicleId].isAvailable = true;
    }

    function getShipmentDetails(uint256 shipmentId)
        public
        view
        returns (ShipmentDetails memory)
    {
        require(shipmentId <= shipmentCount, "Invalid shipment ID");
        return shipments[shipmentId];
    }
}

